import * as React from 'react';
import {
  Grid,
  Typography,
  Card,
  CardHeader,
  CardContent,
  Divider,
  ButtonGroup,
  Button,
} from '@material-ui/core';
import useTranslations from '../../hooks/useTranslations';

import useStyles from './style';

const Property: React.FunctionComponent = () => {
  const classes = useStyles();
  const { t } = useTranslations();

  return (
    <div className={classes.root}>
      <Grid container spacing={4}>
        <Grid item xs={12} sm={6}>
          <Typography variant="body1">{t('administration')}</Typography>
          <Typography variant="h6">Gebäude & Räume</Typography>
        </Grid>
      </Grid>
      <Grid container spacing={4}>
        <Grid item xs={12} sm={6}>
          <Grid container spacing={1}>
            <Grid item xs={12} sm={6}>
              <Card>
                <CardHeader title="Gebäude 1" />
                <Divider />
                <CardContent>
                  <Typography variant="body1">Beschreibung</Typography>
                  <Divider />
                  <ButtonGroup variant="outlined">
                    <Button>Ansehen</Button>
                    <Button>Bearbeiten</Button>
                    <Button>Köschen</Button>
                  </ButtonGroup>
                </CardContent>
              </Card>
            </Grid>
          </Grid>
        </Grid>
      </Grid>
    </div>
  );
};

export default Property;
